const HomePage = () => {
 return (
  <div>
 <h1>This is the welcome Page</h1>
 <p>
  Go to &nbsp;&nbsp;&nbsp;<Link to="/products">
  List of Products </Link>
  </p>
  </div>
 );
}

export default HomePage;
